import { Col, Row } from 'antd'
import React from 'react'
import { Redirect, Route } from 'react-router-dom'
import MenuEvo from '../../components/MenuEvo/MenuEvo'

import { Layout } from 'antd';
import './LayoutSecondary.scss';




//const user = null;
const user = { id: 1, username: "luis" }
const { Header, Content } = Layout;

export default function LayoutSecondary({title: Title,component: Component, ...rest}) {

    return (
        <Route {...rest}>
             {user ? 
             (<>
                
                <Layout>
                    <Row>
                        <Col span={2} className="menuSide">        
                            <MenuEvo />
                        </Col>
                    
                        <Col span={22} className="contentFrame">
                            <Header style={{background: "yellow"}}>
                                <h3>{Title}</h3>
                            </Header>
                            <Content>
                                <Component/>
                            </Content>
                        </Col>
                    </Row>
                </Layout> 
             
             </>) : (<Redirect to="/login" />) }
       </Route>
    )
}
